import React, { Component } from "react";
import { Route, Switch } from "react-router-dom";
import Proof from "./Subcomponents/Proof";
import Anagram from "./Subcomponents/Anagram";
import "./Projects.css";

class Projects extends Component {
  render() {
    return (
      <div className="projectMain">
        {/* <div className="projectContainer"> */}
        <div className="sidebar">
          <Link to="/projects" className="projectHeader">
            My Projects
          </Link>
          <ul>
            <li>
              <Link to="/projects/anagram" className="sideName" id="anagram">
                Anagram Generator
              </Link>
            </li>
            <li>
              <Link to="/projects/proof" className="sideName" id="proof">
                Proof Technology Webpage
              </Link>
            </li>
          </ul>
        </div>
        <Switch>
          <Route path="/projects" component={Projects} />
          <Route path="/projects/anagram" component={Anagram} />
          <Route path="/projects/anagram" component={Proof} />
        </Switch>
      </div>
    );
  }
}
export default Projects;
